const SearchItem = ({handleSearchChange, searchItem, setSearchItem}) => {
  return (
        <form className="searchForm" onSubmit={(e)=>{e.preventDefault()}}>
                <input
                    type="text"
                    onChange={(e)=>setSearchItem(e.target.value)}
                    value={searchItem}
                    placeholder = "Search List"
                    
                />


        </form>
  )
}

